import React, { useContext } from "react";

import { GridContext } from "../contexts/GridContext";
import "../App";

const Note = props => {
  const { mouseDown, edit } = useContext(GridContext);
  return (
    <div
      className={props.class}
      onMousedown={() => {
        props.setGrid(props.note, props.instrument);
      }}
      onMouseEnter={() => {
        if (mouseDown) console.log("yessss");
      }}
    ></div>
  );
};

export default Note;
